import React from 'react';
import Title from './Title.js';
import NoteView from './NoteView.js';
import Note from './Note.js';
import './App.css';

function App() {
  return (
    <div className="App">
      <Title />
      {/* <NoteView /> */}
      <div className="notes">
        <Note style={{ display: "inline-block" }} />
        <Note style={{ display: "inline-block" }} />
      </div>
      <div style={{ display: "inline-block" }}>
        Hello
      </div>
      <div style={{ display: "inline-block" }}>
        Hello
      </div>
    </div>
  );
}

export default App;
